import React from "react";

const KeepData = (props) => {
    return (
        <>
            <div className = "container ">
                <div className = "row">
                    <div className = "col-md-3 col-12">
                        <div className = "disp1">
                            <h5>{props.value}</h5>
                            <p>{props.value1}</p>
                        </div>
                    </div>
                </div>
            </div> 
        </>
    );
}
export default KeepData;
